            </div>
            {/*inner block end here*/}
            {/*copy rights start here*/}
            <Footer />
            {/*COPY rights end here*/}
          </div>
        </div>
        {/*//content-inner*/}
        {/*/sidebar-menu*/}
          <Sidebar />
        <div className="clearfix" />		
      </div>
    )
}
